window.Papa={parse:(text,opts)=>{
  const lines=text.replace(/\r/g,'').split('\n').filter(x=>x.trim().length>0);
  const header=lines[0].split(',');
  const data=lines.slice(1).map(l=>{
    const cols=l.split(','); const o={};
    header.forEach((h,i)=>o[h.trim()]=cols[i]!==undefined?cols[i].trim():'');
    return o;
  });
  return {data,meta:{fields:header}};
}};